import '../styles/Home.css';
import { useParams } from "react-router-dom";
import { useReducer } from 'react';
import NotePreview from "./../elements/NotePreview";
import { useOutletContext } from "react-router-dom";



function Home() {
  const { elementID, mode } = useParams();
  const [navigationBarState] = useOutletContext();
  console.log(navigationBarState)
  return (
    <div className='body'>
      <div className='navigation-bar'>
        <div className='navigation-header'>
          <div>Notes</div>
          <button onClick={addNewNote()}>+</button>
        </div>
        <div className='navigation-items'>
          <NotePreview title="Title" preview="Preview"></NotePreview>
        </div>
      </div>
      <div className='content-container'>content-contain {elementID}</div>
    </div>
  );
}

export default Home;
